async () => {
    const entityAddr = await SelectEntityAddressDetails.run();

		if (entityAddr.length == 1) {
			try {
				await InsertEntityCommAddressDetails.run({ data: entityAddr[0] });
				await InsertEntityRegAddressDetails.run({ data: entityAddr[0] });
				return true;
			} catch (e) {
				return false;
			}
		} else {
			const entityRegAddr = await SelectEntityRegAddressDetails.run();
			const entityCommAddr = await SelectEntityCommAddressDetails.run();

			if (entityRegAddr.length === 1) {
				try {
					await InsertEntityRegAddressDetails.run({ data: entityRegAddr[0] });
				} catch (e) {
					return false;
				}
			}
			if (entityCommAddr.length === 1) {
				try {
					await InsertEntityCommAddressDetails.run({ data: entityCommAddr[0] });
				} catch (e) {
					return false;
				}
			}
			return true;
		};
  }

